import React from 'react';
import imgs1 from '../assets/images/birds1.jpg';
import imgs2 from '../assets/images/birds2.jpg';
import imgs3 from '../assets/images/birds3.jpg';

function Testimonial() {
    return (
        <div className="container-fluid bg-3 text-center">    
            <h3 className="margin">Where To Find Me?</h3>
            <div className="row">
                <div className="col-sm-4">
                <p>Lorem ipsum dolor sit amet, consectetur adipisicing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua.</p>
                <img src={imgs1} className="img-responsive margin" style={{width:'100%'}} alt="Image"></img>
                </div>
                <div className="col-sm-4"> 
                <p>Lorem ipsum dolor sit amet, consectetur adipisicing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua.</p>
                <img src={imgs2} className="img-responsive margin" style={{width:'100%'}} alt="Image"></img>
                </div>
                <div className="col-sm-4"> 
                <p>Lorem ipsum dolor sit amet, consectetur adipisicing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua.</p>
                <img src={imgs3} className="img-responsive margin" style={{width:'100%'}} alt="Image"></img>
                </div>
            </div>
        </div>
    )
} 
export default Testimonial;
